import React, { Component } from 'react';
import { withRouter } from 'react-router-dom'
import { inject, observer } from 'mobx-react'
import { WingBlank, WhiteSpace, Steps } from 'antd-mobile'
import './index.less'
import StepOne from './StepOne'
import StepTwo from './StepTwo'
import StepThree from './StepThree'


const Step = Steps.Step;

@withRouter
@inject('SignupStore')
@observer
class Singup extends Component {
  state = {
    curStep: 0
  }
  renderCurStep = () => {
    switch (this.state.curStep) {
      case 0:
        return <StepOne />
      case 1:
        return <StepTwo />
      case 2:
        return <StepThree />
      default:
        break;
    }
  }


  render() {
    const { SignupStore: { curStep } } = this.props
    const { clientHeight } = this.props
    return (
      <div style={{height: clientHeight}} className="container">
        <WingBlank mode={20} className="stepsExample">
          <Steps current={curStep} direction="horizontal">
            <Step />
            <Step />
            <Step />
          </Steps>
          <WhiteSpace />
          {this.renderCurStep()}
        </WingBlank>
      </div>
    )
  }
}

export default Singup;
